import React from 'react';
import Sdata from './Sdata';
import Cards from './Card';


const State = ()=>{
    let Series = 'netFlix';
    if(Series === 'netFlix'){
        return (
            <>
            <Cards key={Sdata[0].id}
                imgsrc={Sdata[0].imgsrc}
                title={Sdata[0].title}
                sname={Sdata[0].sname}
                link={Sdata[0].link} />


                <Cards key={Sdata[1].id}
                imgsrc={Sdata[1].imgsrc}
                title={Sdata[1].title}
                sname={Sdata[1].sname}
                link={Sdata[1].link} />
            </>
        )
    }
}

const App = ()=>{
    return(
    <>  <h1 className="heading_style">LIST OF TOP 5 NETFLIX SERIES IN 2021</h1>
<div className="flexBox">
{Sdata.map((value) =>{
    return (
        <Cards key={value.id}
        imgsrc={value.imgsrc}
        title={value.title}
        sname={value.sname}
        link={value.link}
      />
    )

})}

    
</div>
</>
    )
}

export default App;
